import axios from 'axios';

const baseApiUrl = 'http://localhost:3000';

export const getItemsDb = () => {
    return axios.get(baseApiUrl)
        .then(response => response.data);
};

export const postItemsDb = () => {
    return axios.get(baseApiUrl)
        .then(response => response.data);
};
